import Contato from './componentes/contato'
import Inicio from './componentes/Inicio'
import Sevicos from './componentes/Servicos'
function App() {
  return (
    <div className="App">
   <Cabecalho/>
   <Inicio/>
   <Sevicos/>
    <Site/>
    <Contato/>
    <Rodape/>


    </div>
  );
}

export default App;
